import React,{useState,useEffect} from 'react'
import Input from '@material-ui/core/Input'


const CaseDonnee = ({name,value}) => {
    
    
    return ( 
        <> 
        <label for={name}>
            {name}
        </label>
        <Input 
            name={name}
            disabled 
            inputProps={{ 'aria-label': 'description' }} 
            value={value}
            style={{
                backgroundColor:"gray",
            }}
            label="test"
        />

        </>



    );
}
 
export default CaseDonnee;
